export default function AboutTags() {
  const arrayTags = [
    cats,
    lasagne,
    movies,
    gaming,
    fantasy,
    cyberpunk,
    gorillaz,
    kakao,
    kazoo,
    shrek,
  ];
  return (
    <section>
      <ul>
        {arrayTags.map((element) => {
          <li>{element}</li>;
        })}
      </ul>
    </section>
  );
}
